import React from "react";
import { Label } from "../Label/Label";
import {
  ContainerAssessment,
  ContainerCard,
  ContainerHeader,
  ContainerIcon,
  ContainerInformations,
} from "./components";

const RoleItem = ({ item }) => {
  return (
    <ContainerCard>
      <ContainerIcon>Icon</ContainerIcon>
      <ContainerInformations>
        <ContainerHeader>
          <Label>{item.nome}</Label>
          <button
            onClick={() =>
              window.open(
                `https://www.google.com.br/maps/search/${item.nome}`,
                "_blank"
              )
            }
          >
            Maps
          </button>
        </ContainerHeader>
        <Label>{item.categoria}</Label>
        <Label>{item.cidade}</Label>
        <Label>{`Possui espaço kids? ${item.kids}`}</Label>
        <ContainerAssessment>
          <Label>{item.nota}</Label>
          <Label>{item.valor}</Label>
        </ContainerAssessment>
      </ContainerInformations>
    </ContainerCard>
  );
};

export default RoleItem;
